import React, {useState, useEffect} from 'react';
import classes from '../../../CSS/GameStyle.module.css';
import { checkPropTypes } from 'prop-types';
const InputPad = (props) =>{
    const [style,setStyle] = useState({})
    let Xcoords = props.Xcoords-64
    let Ycoords= props.Ycoords -65
    setTimeout(()=>{
        const newStyle =({
            left: Xcoords,
            top: Ycoords,
            opacity: 1
        })
        setStyle(newStyle)
    },50)
    return(
        <div className={classes.PadContainer} style={{left:`${Xcoords}`,top:`${Ycoords}`,opacity:1}} >
            <ul className={classes.Padstyle}  >
                <li>1</li>
                <li>2</li>
                <li>3</li>
                <li>4</li>
                <li>5</li>
                <li>6</li>
                <li>7</li>
                <li>8</li>
                <li>9</li>
            </ul>
        </div>
    )
}
export default InputPad;
